import { makeStyles } from "@mui/styles";



export const useStyles = makeStyles({

  container:{
    width:1200,
    margin:'0 auto',
  },
  images:{
    justifyContent:'space-between'
  },
  topic:{
    textTransform:'uppercase'
  }

})
